import React from 'react';

const MenuPage = ({ categories, showProducts, goBack }) => {
  return (
    <div>
      <h1>Menu</h1>
      <button onClick={goBack}>Back</button>
      <h2>Categories:</h2>
      <ul>
        {categories.map(category => (
          <li key={category}>
            <button onClick={() => showProducts(category)}>{category}</button>
          </li>
        ))}
      </ul>
      <h2>Menu Items:</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {/* Render menu items here */}
          {/* Example row */}
          <tr>
            <td>Cheeseburger</td>
            <td>Classic cheeseburger with lettuce, tomato, and cheese</td>
            <td>$9.99</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default MenuPage;
